INSERT INTO `form` VALUES ('EQE128.1S07.820121110031900UM0_IMMEDIATE-1358148820161', '<html>\n <head> \n  <meta http-equiv=\'Content-Type\' content=\'text/html\' charset=\'utf-8\' /> \n </head> \n <body id=\'temp_1696187233\' style=\'WIDTH: auto; HEIGHT: auto\' tname=\'_IMMEDIATE\' tdescription=\'地震烈度报表\' ctype=\'eq_template_B11-2\'> \n  <p align=\'center\'><font size=\'6\'><strong>地震研判衰减结果-烈度</strong></font></p> \n  <p align=\'center\'><img alt=\'\' hspace=\'0\' src=\'http://localhost:8080/EngineWeb/template//liedu.jpg\' align=\'baseline\' border=\'0\' /></p> \n  <p align=\'center\'>&nbsp;&nbsp;&nbsp; 日前，北京市地震监测预报中心召开了援疆地震业务培训工作专题座谈会。中心领导、各研究室主任和新疆和田地震局前来我局参加地震监测预报业务培训的科技人员孙志飞、买买吐送参加了座谈会。中心主任邢成起向和田地震局的同志详细介绍了本中心开展地震监测预报工作的情况，和田地震局的同志结合其工作实际提出了此次参加业务培训的需求。经过双方充分的讨论、沟通，最后制定出了具体的培训计划。</p> \n  <p align=\'center\'><img alt=\'\' hspace=\'0\' src=\'http://www.csi.ac.cn/manage/content/docmanage/previewImg1.jsp?filePath=/amao/zs/r1.jpg\' align=\'baseline\' border=\'0\' /></p> \n  <p align=\'left\'>　　按照和田地震局的工作安排，<input disabled=\'\' value=\'modelresult_economic\' index=\'0\' propertyname=\'longitude\' tablename=\'modelresult_economic\' />此次选派科技人员到我局的业务培训为期两个月时间。<input disabled=\'\' index=\'6\' propertyname=\'intensity\' tablename=\'modelresult_intensity\' />为了切实做好培训工作，监测预报中心将培训任务落实到人，<input disabled=\'\' index=\'6\' propertyname=\'azimuth\' tablename=\'modelresult_intensity\' />大家一致表示要全力做好此项工作，使培训工作取得扎实成效，让和田地震局的同志满意而归，为新疆和田的防震减灾事业多做贡献.</p>  \n </body>\n</html>', '', '');
INSERT INTO `form` VALUES ('EQE128.1S07.820121110031900UM0_IMMEDIATE-1358155817477', '<html>\n <head> \n  <meta http-equiv=\'Content-Type\' content=\'text/html\' charset=\'utf-8\' /> \n </head> \n <body id=\'temp_1696187233\' style=\'WIDTH: auto; HEIGHT: auto\' tname=\'_IMMEDIATE\' tdescription=\'地震烈度报表\' ctype=\'eq_template_B11-2\'> \n  <p align=\'center\'><font size=\'6\'><strong>地震研判衰减结果-烈度</strong></font></p> \n  <p align=\'center\'><img alt=\'\' hspace=\'0\' src=\'http://localhost:8080/EngineWeb/template//liedu.jpg\' align=\'baseline\' border=\'0\' /></p> \n  <p align=\'center\'>&nbsp;&nbsp;&nbsp; 日前，北京市地震监测预报中心召开了援疆地震业务培训工作专题座谈会。中心领导、各研究室主任和新疆和田地震局前来我局参加地震监测预报业务培训的科技人员孙志飞、买买吐送参加了座谈会。中心主任邢成起向和田地震局的同志详细介绍了本中心开展地震监测预报工作的情况，和田地震局的同志结合其工作实际提出了此次参加业务培训的需求。经过双方充分的讨论、沟通，最后制定出了具体的培训计划。</p> \n  <p align=\'center\'><img alt=\'\' hspace=\'0\' src=\'http://www.csi.ac.cn/manage/content/docmanage/previewImg1.jsp?filePath=/amao/zs/r1.jpg\' align=\'baseline\' border=\'0\' /></p> \n  <p align=\'left\'>　　按照和田地震局的工作安排，<input disabled=\'\' value=\'modelresult_economic\' index=\'0\' propertyname=\'longitude\' tablename=\'modelresult_economic\' />此次选派科技人员到我局的业务培训为期两个月时间。<input disabled=\'\' index=\'6\' propertyname=\'intensity\' tablename=\'modelresult_intensity\' />为了切实做好培训工作，监测预报中心将培训任务落实到人，<input disabled=\'\' index=\'6\' propertyname=\'azimuth\' tablename=\'modelresult_intensity\' />大家一致表示要全力做好此项工作，使培训工作取得扎实成效，让和田地震局的同志满意而归，为新疆和田的防震减灾事业多做贡献.</p>  \n </body>\n</html>', '', '');
